import React from "react";
import "./index.css";

function Input(){
    return(
        <div>

           <div className="Inputflex">
            <div>
                <text className="Inputclick">Treated water quality data</text>
            </div>
            <div>
                <text className="Inputclickstate">Flow meter data</text>
            </div>
            <div>
                <text className="Inputclickstate">Power Consumption</text>
            </div>
           </div>

               
        </div>
    )
}
export default Input;
